// test.js
import React, { Component } from 'react'
import marked from 'marked'

const md = '### test'

marked.setOptions({ // marked 设置
    renderer: new marked.Renderer(),
    gfm: true,
    tables: true,
    breaks: true,
    pedantic: false,
    sanitize: false,
    smartLists: true,
    smartypants: false
})

class Test extends Component {
    render () {
        const strHtml = marked(md)
        return (
            <div>
                <div>
                    {strHtml}
                </div>
            </div>
        )
    }
}

export default Test
